body:
This PR removed the incompatible fetch API interfaces in respect to #12476 and #12582, and added new API interfaces as per [Sercive Worker Draft](https://www.w3.org/TR/service-workers).

@mohsen1 we have no choice but to merge the `ServiceWorkerGlobalScope` interface into `Window`, since there's no other global scopes. Meanwhile, some interfaces in `ServiceWorkerGlobalScope`, eg. `onmessage`, are not compatible with those in `Window`, I don't know if there are some workarounds other than rewriting them like:

```ts
interface ServiceWorkerGlobalScope {
    // onmessage: (messageevent: ExtendableMessageEvent) => void;
    onmessage: (messageevent: MessageEvent) => void;
}
``` 

Update: I found that [`lib.webworker.d.ts`](https://github.com/Microsoft/TypeScript/blob/master/lib/lib.webworker.d.ts) is using a `/// <reference no-default-lib="true"/>` directive to exclude the default lib, however when I tried adding the same directive to this lib, I got tons of type missing errors 😢.

